import { PureComponent } from 'react';
import { StyledApplication } from '../components/styled';

export default class Index extends PureComponent {
    render() {
        return (
            <StyledApplication>
                <h1>Unnamed App</h1>

                <button>Login</button>
            </StyledApplication>
        )
    }
}
